import React from 'react'
import {useFormik} from 'formik'

function AddEmployee()
{

        const employee = useFormik({
            initialValues : {
                firstname : '',
                lastname : '',
                gender : '',
                qual : ''
            },
            onSubmit : (values)=>{
                 console.log(values)
            }
        })
    return (
        <section className='m-4 p-2'>

             <form onSubmit={employee.handleSubmit}>
                FirstName<input type='text' {...employee.getFieldProps('firstname')}/> <br/><br/>
                LastName<input type='text' {...employee.getFieldProps('lastname')}/> <br/><br/>
                Gender &nbsp;<input type='radio' value= 'Male' {...employee.getFieldProps('gender')}/>Male  &nbsp;
                <input type='radio' value= 'Female' {...employee.getFieldProps('gender')}/> Female <br/><br/>
                Qualification<input type='text' {...employee.getFieldProps('qual')}/> <br/><br/>
                
                 <button type='submit'>Submit</button>
             </form>
            

        </section>
    )
}

export default AddEmployee
